import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Changelogs from './containers/Changelogs';
import Home from './containers/Home';
import JobGuide from './containers/JobGuide';
import ScrollToTop from './components/ScrollToTop.js';
import {
  ScrollManager,
  WindowScroller,
  ElementScroller,
} from 'react-scroll-manager';
import { createBrowserHistory as createHistory } from 'history';

class AppRouter extends Component {
  constructor() {
    super();
    this.history = createHistory();
  }
  render() {
    return (
      <ScrollManager history={this.history}>
        <Router history={this.history}>
          <ScrollToTop />
          <Switch>
            <WindowScroller>
              <ElementScroller scrollKey='nav'>
                <Route exact path='/' component={Home} />
              </ElementScroller>
              <Route exact path='/job-guide/:id' component={JobGuide} />
              <Route exact path='/changelogs' component={Changelogs} />

              {/* Personal Information */}
            </WindowScroller>
          </Switch>
        </Router>
      </ScrollManager>
    );
  }
}

export default AppRouter;
